description:
Distance and Time is the second album of original studio material from British musician Fink. It was released on 1 October 2007 on the Ninja Tune independent record label.


1. &quot;Trouble's What You're In&quot;
2. &quot;This Is The Thing&quot;
3. &quot;If Only&quot;
4. &quot;Blueberry Pancakes&quot;
5. &quot;Get Your Share&quot;
6. &quot;Under The Same Stars&quot;
7. &quot;So Many Roads&quot;
8. &quot;Make It Good&quot;
9. &quot;Little Blue Mailbox&quot;
